import "./feed.css";
import Post from "../post/Post";
import Content from "../content/Content";
import { Contents } from "../../dummyData";

export default function Feed() {
  return (
    <div className="feedContainer">
      <div className="feedWrapper">
        <Post />
        {Contents.map((i) => (
          <Content key={i.id} content={i} />
        ))}
      </div>
    </div>
  );
}
